package org.kiirun.adventofcode.day5;

import com.google.common.base.CharMatcher;
import com.google.common.collect.Lists;
import reactor.core.publisher.Flux;
import reactor.core.publisher.Mono;
import reactor.function.TupleUtils;
import reactor.util.function.Tuple3;
import reactor.util.function.Tuples;

import java.util.Comparator;
import java.util.List;
import java.util.function.BiFunction;
import java.util.function.Predicate;

public class Day5 {
    private static final String INPUT = "";
    private static final List<Character> ALPHABET = Lists.charactersOf("abcdefghijklmnopqrstuvwxyz");

    public static void main(String[] args) {
        final PolymerReducer fullReducer = new PolymerReducer();
        final int allUnits = INPUT.length();
        final Flux<Character> polymerUnits = Mono.just(INPUT)
                                                     .flatMapIterable(Lists::charactersOf)
                                                     .cache();
        polymerUnits
                .reduce("", fullReducer)
                .map(String::length)
                .map(units -> units + "/" + allUnits + " units remain.")
                .subscribe(System.out::println);

        Flux.fromIterable(ALPHABET)
                .map(UnitFilter::new)
                .flatMap(unitFilter -> Mono.just(unitFilter)
                                               .flatMapMany(polymerUnits::filter)
                                               .reduce("", fullReducer)
                                               .map(reduced -> Tuples.of(unitFilter.getUnit(), reduced, reduced.length())))
                .sort(Comparator.comparing(Tuple3::getT3))
                .next()
                .subscribe(TupleUtils.consumer((reducedCharacter, reduced, length) ->
                                                       System.out.println("Best result after removing '" + reducedCharacter + "': " + length + "/" + allUnits + " remaining units.")));
    }

    private static class PolymerReducer implements BiFunction<String, Character, String> {
        private static final CharMatcher LOWER = CharMatcher.inRange('a', 'z');
        private static final CharMatcher UPPER = CharMatcher.inRange('A', 'Z');

        @Override
        public String apply(String reduced, Character character) {
            if (reduced.isEmpty()) {
                return character.toString();
            }
            if (willVanish(reduced.charAt(reduced.length() - 1), character)) {
                return reduced.substring(0, reduced.length() - 1);
            }
            return reduced + character;
        }

        private boolean willVanish(Character c1, Character c2) {
            return ((LOWER.matches(c1) && UPPER.matches(c2)) || (UPPER.matches(c1) && LOWER.matches(c2)))
                           && Character.toLowerCase(c1) == Character.toLowerCase(c2);
        }
    }

    private static class UnitFilter implements Predicate<Character> {
        private final Character unit;

        private final CharMatcher unitMatcher;

        public UnitFilter(Character unit) {
            this.unit = unit;
            unitMatcher = CharMatcher.isNot(Character.toLowerCase(unit))
                                  .and(CharMatcher.isNot(Character.toUpperCase(unit)));
        }

        @Override
        public boolean test(Character character) {
            return unitMatcher.matches(character);
        }

        public Character getUnit() {
            return unit;
        }
    }
}
